INSERT INTO `subjects` (`id`, `name`, `location`, `desc`, `image`, `createdAt`, `updatedAt`) VALUES
(1, 'Lập trình python cơ bản', '566 Núi Thành - Hải Châu - Đà Nẵng', 'Khóa học lập trình Python cơ bản với các bài tập và lý thuyết dễ hiểu, học xong bạn có thể tự tin để tới với các chủ đề nâng cao hơn của Python', , '2022-11-25 11:26:32', '2022-11-25 12:15:12');
INSERT INTO `subjects` (`id`, `name`, `location`, `desc`, `image`, `createdAt`, `updatedAt`) VALUES
(2, 'Lập trình ứng dụng mobile trên ios', '566 Núi Thành - Hải Châu - Đà Nẵng', 'Lập trình iOS là công việc xây dựng và phát triển bằng ngôn ngữ lập trình Swift trên các ứng dụng của thiết bị iPhone, iPad', , '2022-11-25 11:28:03', '2022-11-25 11:28:03');
INSERT INTO `subjects` (`id`, `name`, `location`, `desc`, `image`, `createdAt`, `updatedAt`) VALUES
(3, 'Lập trình ứng dụng mobile trên android', '566 Núi Thành - Hải Châu - Đà Nẵng', 'Android là một hệ điều hành được phát triển bởi “Gã khổng lồ” – Google dựa trên nền tảng Linux. Từ khi xuất hiện tới nay, Android được phổ biến trên toàn thế giới và lượng người dùng ngày một gia tăng.', , '2022-11-25 11:29:35', '2022-11-25 11:29:35');
INSERT INTO `subjects` (`id`, `name`, `location`, `desc`, `image`, `createdAt`, `updatedAt`) VALUES
(4, 'Lập trình website bằng thư viện React JS', '566 Núi Thành - Hải Châu - Đà Nẵng', 'ReactJS là một opensource được phát triển bởi Facebook, ra mắt vào năm 2013, bản thân nó là một thư viện Javascript được dùng để để xây dựng các tương tác với các thành phần trên website. ', , '2022-11-25 11:31:20', '2022-11-25 11:31:20');

